import React, { Component } from 'react';
import { connect } from 'react-redux';

class Feedback extends Component {
  render() {
    const { sectionGamer } = this.props;
    return (
      <div>
        <div>
          <h1 data-testid="header-player-name">Nome do jogador</h1>
          <img alt="avatar" src="https://www.com.br" data-testid="header-profile-picture" />
          <p data-testid="header-score">Pontuação</p>
        </div>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({
  sectionGame: state.sectionReducer.player,
});

export default connect(mapStateToProps)(Feedback);
